import {
    BrowserRouter as Router,
    Routes,
    Route
  } from "react-router-dom";
  import Login from "./login";
  import Register from "./register";
  
  function App() {
    return (
          <main>
            <Router>
                <Routes>
                    <Route path="/login" element={<Login />} />
                  </Routes>
                </Router> 
  
              <Router>
              <Routes>
                <Route path="/" element={<Register />} />
                </Routes>
              </Router> 
              </main>
    );
  }
  
  export default App;
